import Home from './components/Home'
import Navigator from './components/Navigator'
import React, { useEffect, useState } from 'react';

import 'bootstrap/scss/bootstrap.scss'

function App() {
  const hasContent = true;
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('http://localhost:8080/restaurant/RM77EX')
        .then(response => response.json())
        .then(data => setData(data))
        .catch(error => console.error('There was an error!', error));
}, []);

  return (
   <>
   <div>
            {data ? <p>{data.someField}</p> : <p>Loading...</p>}
        </div>
   <Navigator />
   {/* This part controls whether the json data of restaurants is empty or not */}
   {hasContent ? <Home /> : <span>Sorry there is nothing there</span>}

   </>
  );
}

export default App;
